import { headerData } from "./headerData";
import HeaderLayout from "./headerLayout";
import "./headerSlider.css";
import React from "react";
import Slider from "react-slick";

export class HeaderSlider extends React.Component {
  render() {
    const settingBannerSlide = {
      // centerMode: true,
      lazyLoad: false,
      slidesToShow: 1,
      slidesToScroll: 1,
      arrows: true,
      fade: true,
      infinite: false,
      focusOnSelect: false,
      initialSlide: 0, // slide to start
      useTransform: false,
      waitForAnimate: true,
      dots: false,
      // asNavFor: ".thumbnail_slider",
    };
    return (
      <>
        <div className="a_header__layout_">
          <Slider className="a_header__sliders_" {...settingBannerSlide}>
            {/* <HeaderLayout headerData={headerData} />
            <HeaderLayout headerData={headerData} /> */}
            <div style={{background: "black", width: "100vw", height:"100vh"}}></div>
          </Slider>
        </div>
      </>
    );
  }
}
